import { launch, PaperFormat, PDFOptions } from "puppeteer";
import axios from "axios";
import { Account, Services } from "@tago-io/sdk";
import moment from "moment";
import { UserInfo } from "@tago-io/sdk/out/modules/Account/run.types";
import { TagoContext } from "@tago-io/sdk/out/modules/Analysis/analysis.types";

// ? ==================================== (c) TagoIO ====================================
// ? What is in this file?
// * This file creates a PDF and send it via email, the PDF file will contain a headerTemplate and footerTemplate and should receive a HTML body throught the function call.
// ? ====================================================================================

//code below is a base64 code for MyCompany logo
const headerTemplate = `
<div class="header" style="background-color: rgba(47, 48, 101, 0.1); align-items: center; padding: 0px 30px; font-size: 30px; width: 100%; color:black !important; margin:0px 20px 80px 20px; border-radius: 8px 8px 0 0; -webkit-print-color-adjust: exact; height: 60rem;">
  <div style="display: inline-block; margin: 0 2rem; vertical-align: top; text-align: start; width: 70%;">
    <h1 style="font-weight: 400; color:black !important; font-size: 18px;">$ORG_NAME$ - Sensor Report</h1>
    <h1 style="font-weight: 400; font-size: 10px;">${moment().format("MMMM Do YYYY")}</h1>
  </div>
  <div style="display: inline-block; width: 25%; margin-top:15px;">
    <img
    src="data:image/png;base64,"
    alt="mycompany logo"
    style="width: 100%; vertical-align: top; max-height: 60px; display:block;"
    />
  </div>
</div>
`;

const footerTemplate = `
<div style="color: white; background-color: rgba(47, 48, 101, 0.1); font-size: 10px; padding: 5px; margin:0px 20px; text-align: center; width: 100%; -webkit-print-color-adjust: exact; border-radius: 0 0 8px 8px;">
<div style="display: inline-block; width: 10%; margin: auto">
<img
src="data:image/png;base64,"
alt="mycompany logo"
style="width: 100%; vertical-align: top; max-height: 30px; display:block;"
/>
</div>
</div>
`;

const options: PDFOptions = {
  path: "example.pdf", //changes the path where the file will be stored
  displayHeaderFooter: true,
  headerTemplate,
  footerTemplate,
  format: "A4" as PaperFormat,
  margin: {
    bottom: 70,
    left: 25,
    right: 35,
    top: 110,
  },
  printBackground: true,
};

export default async function createPDF(context: TagoContext, htmlBody: string, users_info_list: Array<UserInfo>, org_name: string) {
  options.headerTemplate = headerTemplate.replace("$ORG_NAME$", org_name);
  const base64 = Buffer.from(htmlBody).toString("base64");
  const result = await axios.post("https://pdf.tago.io", { base64, options });
  const pdf = result.data.result;

  // Start the email service
  const email = new Services({ token: context.token }).email;

  // Send the email.
  users_info_list.forEach(async (user_info) => {
    if (user_info?.email) {
      await email.send({
        to: user_info?.email,
        subject: "System Report",
        message: "Find attached your PDF below.",
        attachment: {
          archive: pdf,
          type: "base64",
          filename: "sensor_report.pdf",
        } as any,
      });
    } else {
      console.log("Error - couldnt find user");
    }
  });

  return context.log("PDF Generated!");
}
